import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Navbar from '../navSection/Navbar';
import AccountBalanceIcon from '@mui/icons-material/AccountBalance';const Profile = () => {
  return (
    <div>
        <Navbar/>
      <Container>
        <Row className="balance-info my-2">
          <Col className='d-flex p-3 border   justify-content-between '>
            <div className="d-flex flex-column ">
              {' '}
              <div className='d-flex flex-column mb-2'>
                {' '}
                Available balance:
                <strong> N76,030.00</strong>
              </div>
              {/* Link or button for Sales History */}
              <div >
                {' '}
                <Button variant="success" className='fw-bold d-flex align-items-center'><AccountBalanceIcon/>CashOut</Button>
              </div>
            </div>
            <div className='text-end'>
              {' '}
              <Button variant="link text-success">Sales History</Button>
            </div>
          </Col>
     
        </Row>

        <Row className="cash-out">
          <Col></Col>
        </Row>

        <Form className="search-store">
          {/* Replace with actual form elements and functionality */}
          <Form.Control type="text" placeholder="search your store..." />
        </Form>

        {/* Map through new orders and display them as list items */}
        {/* This is just a static example */}

        {['New Order 1', 'New Order 2', 'New Order 3'].map((order) => (
          // Replace with actual order data and structure
          // This is just a static example
          <li>{order}</li>
        ))}
      </Container>
    </div>
  );
};

export default Profile;
